function getDecorativeTitleByNumber(number, title, spacing, color, fontSize, multiplicator, centerItem, patern) {
  console.log(centerItem);
  const titles = [];
  let style = {};



  spacing = spacing * multiplicator;
  fontSize = fontSize * multiplicator;

  for (let i = 0; i < number; i++) {
    if (patern === "alternate") {
      if (i % 2 === 1) {
        style = {
          marginBottom: -spacing + "vw",
          color: "#000",
          fontSize: fontSize + "vw",
          WebkitTextStroke: "1px " + color
        }
      } else if (i % 2 === 0) {
        style = {
          marginBottom: -spacing + "vw",
          color: color,
          fontSize: fontSize + "vw"
        }
      }
    } else {
      if (i !== number - 1) {
        style = {
          marginBottom: -spacing + "vw",
          color: "#000",
          fontSize: fontSize + "vw",
          WebkitTextStroke: "1px " + color
        }
      } else {

        style = {
          marginBottom: -spacing / 4 + "vw",
          color: color,
          fontSize: fontSize + "vw"
        }
      }
    }
    titles.push(
      <h1
        className={title + "Title"}
        style={style}
      >{title}
      </h1>
    )
  }
  return <div className={title + "TitleContainer"} style={{
    textAlign: "center",
    margin: "auto"
  }}>{titles}</div>
}

function getArrows(number, direction, space) {

  const arrows = [];

  for (let i = 0; i < number; i++) {

    arrows.push(<svg
      key={i}
      className={`arrow ${direction}`}
      viewBox="0 0 86 87"
      fill="none"
      style={
        {
          marginRight: space / number + "vw",
          marginLeft: space / number + "vw",
        }
      }
    >
      <rect
        width="60.8323"
        height="14.6813"
        transform="matrix(0.703711 0.710487 -0.703711 0.710487 42.9692 0.687073)"
        fill="#E4DFD9"
      />
      <rect
        width="60.06"
        height="14.8701"
        transform="matrix(0.703711 -0.710487 0.703711 0.710487 33.0485 76.0144)"
        fill="#E4DFD9"
      />
    </ svg >);
  }
  return arrows;
}

